import React from 'react';
import '../../App.css';

import HeroSection from '../HeroSection';
import About from './About';
import Skills from './Skills';
import Footer from '../Footer';

function Home() {
  return (
    <>
      <HeroSection />
      <About />
      <Skills />
      <Footer />
    </>
  );
}

export default Home;
